import Home from './pages/Home';
import MainApp from './pages/MainApp';
import Accountpage from './pages/Accountpage';
import { Routes, Route } from "react-router-dom";

const App = () => {
    return(
        <>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/MainApp" element={<MainApp/>} />
            </Routes>
        </>

    )
};

export default App;
